from typing import List
import math


class Solution1:
    def minCapability(self, nums: List[int], k: int) -> int:
        """TLE
        """
        N = len(nums)
        dp = [0] * (N + 1)
        for j in range(1, k + 1):
            tmp = [math.inf] * (2 * j - 1)
            for i in range(2 * j - 1, N + 1):
                tmp.append(min(tmp[i - 1], max(dp[i - 2], nums[i - 1])))
            dp = tmp
        return min(dp)


class Solution2:
    def minCapability(self, nums: List[int], k: int) -> int:
        """First of all, we can prove that robbing k houses is the best option,
        because if robbing more than k houses reaches a minimum capacity, we
        can definitly do it with k houses.

        Then we sort nums based on the money in the house. We can traverse from
        left to right, the first time that we can rob k or more houses, the
        amount of money in that house is the result, because that is the house
        with the lowest amount of money we must rob in order to hit the quota
        of robbing k houses.

        The question becomes, given a list of unsorted indices and the rule of
        not robbing adjacent houses, what is the max number of houses to rob
        in the first j indices.

        We know that given an interval of indices, we can rob at most
        (length + 1) // 2 number of houses. Thus, we need to keep track of all
        newly formed intervals as we traverse through the indices. I use two
        dict to keep track of the intervals. One has key as the left bound and
        value as the right bound (st_dict). The other has the key as the right
        bound and the value as the left bound (ed_dict).

        For each new index i, I check whether i - 1 is in ed_dict. If it is,
        then i is an extension to a previous interval. If i + 1 is in st_dict,
        then i is a pre-pend of a previous interval. There are four situations
        to consider, and we can figure out the number of houses to rob with the
        change in intervals for each situation.

        O(NlogN), 925 ms, faster than 76.53% 
        """
        sorted_nums = sorted((n, i) for i, n in enumerate(nums))
        st_dict, ed_dict = {}, {}
        rob = 0
        for n, i in sorted_nums:
            if i - 1 not in ed_dict and i + 1 not in st_dict:
                st_dict[i] = i
                ed_dict[i] = i
                rob += 1
            elif i - 1 in ed_dict and i + 1 not in st_dict:  # extending an interval
                pre_ed, pre_st = i - 1, ed_dict[i - 1]
                rob -= (pre_ed - pre_st + 2) // 2
                del ed_dict[pre_ed]
                ed_dict[i] = pre_st
                st_dict[pre_st] = i
                rob += (i - pre_st + 2) // 2
            elif i - 1 not in ed_dict and i + 1 in st_dict:  # prepending an interval
                pre_st, pre_ed = i + 1, st_dict[i + 1]
                rob -= (pre_ed - pre_st + 2) // 2
                del st_dict[pre_st]
                st_dict[i] = pre_ed
                ed_dict[pre_ed] = i
                rob += (pre_ed - i + 2) // 2
            else:  # merging two intervals
                pre_st_r, pre_ed_r = i + 1, st_dict[i + 1]
                pre_ed_l, pre_st_l = i - 1, ed_dict[i - 1]
                rob -= ((pre_ed_r - pre_st_r + 2) // 2 + (pre_ed_l - pre_st_l + 2) // 2)
                del st_dict[pre_st_r]
                del ed_dict[pre_ed_l]
                st_dict[pre_st_l] = pre_ed_r
                ed_dict[pre_ed_r] = pre_st_l
                rob += (pre_ed_r - pre_st_l + 2) // 2
            if rob >= k:
                return n


class Solution3:
    def minCapability(self, nums: List[int], k: int) -> int:
        """Binary search, inspired by lee215: https://leetcode.com/problems/house-robber-iv/discuss/3143697/JavaC%2B%2BPython-Binary-Search-O(1)-Space

        We directly search for the minimum capability. For a given capability,
        we want to see if we can rob at least k houses with values smaller or
        equal to minimum capability. If we can, then we can reduce minimum
        capability. Otherwise we increase.

        O(NlogM), 1098 ms, faster than 64.27%
        """
        lo, hi = min(nums), max(nums)
        while lo < hi:
            mid = (lo + hi) // 2
            pre_rob = -2
            rob_total = 0
            for i, n in enumerate(nums):
                if n <= mid and i - 1 != pre_rob:
                    rob_total += 1
                    pre_rob = i
            if rob_total >= k:
                hi = mid
            else:
                lo = mid + 1
        return lo



